const SideBar = ({ open }) => {
  return (
    <div
      className={
        open
          ? " origin-right-left transition:delay-500 duration-300  fixed right-0 lg:w-2/6  mr-1 w-3/4 bg-gray-100 h-full mt-2 "
          : "hidden  "
      }
    ></div>
  );
};


export default SideBar;
